import { useState } from "react";
import styles from "../Header/SideNav.scss";

const SideNav = () => {
    const [isOpen, setIsOpen] = useState(true);
    return (
        <button
            onClick={() => setIsOpen(!isOpen)}
            className={styles["button"]}
        />
    );
};

export default SideNav;
